import { makeStyles } from "@mui/styles"


export const useStyles = makeStyles({
  logo:{
    color:"black",
  },
  headerBar:{
    textAlign:'left',
    backgroundColor:'white',
    boxShadow:'none'
  },
  itemMenu:{
    color:'black'
  },
  menu:{
    display:'flex',
    marginLeft:'20px',
    flexGrow:"1",
    alignItems:'self-start',
    justifyContent:'space-between',
  }
})
